-- ----------------------------
-- Function structure for getChildId_bas_basic_tree_more
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildId_bas_basic_tree_more`;
delimiter ;;
CREATE FUNCTION `getChildId_bas_basic_tree_more`(nodes varchar(1000))
 RETURNS varchar(5000) CHARSET utf8mb4
BEGIN 
       DECLARE pTemp VARCHAR(1000);             
       DECLARE cTemp VARCHAR(5000);  
      
      SET @array_content= nodes; 
       SET @i=1;
       SET @count=CHAR_LENGTH(@array_content) -CHAR_LENGTH(REPLACE(@array_content,',','')) + 1;
      SET pTemp = '$';  

       WHILE @i <= @count DO
          SET cTemp = SUBSTRING_INDEX(SUBSTRING_INDEX(@array_content,',',@i),',',-1);
          WHILE cTemp is not null DO  
            SET pTemp = concat(pTemp,',',cTemp);  
            SELECT group_concat(id) INTO cTemp FROM t_test_category   
            WHERE FIND_IN_SET(pid,cTemp) > 0;
          END WHILE;  
          SET @i = @i + 1; 
      END WHILE; 
      
       RETURN pTemp;  

END
;;
delimiter ;

-- ----------------------------
-- Function structure for getParentId_bas_basic_tree
-- ----------------------------
DROP FUNCTION IF EXISTS `getParentId_bas_basic_tree`;
delimiter ;;
CREATE FUNCTION `getParentId_bas_basic_tree`(rootId varchar(20))
 RETURNS varchar(1000) CHARSET utf8mb4
BEGIN 
   DECLARE fid varchar(100) default ''; 
   DECLARE str varchar(1000) default rootId; -- 节点ID(临时变量)
 
    WHILE rootId is not null  do 
        SET fid =(SELECT pid FROM t_test_category WHERE id = rootId); 
        IF fid is not null THEN 
            SET str = concat(str, ',', fid); 
            SET rootId = fid; 
        ELSE 
            SET rootId = fid; 
        END IF; 
    END WHILE; 
   return str;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for SPLIT_STR
-- ----------------------------
DROP FUNCTION IF EXISTS `SPLIT_STR`;
delimiter ;;
CREATE FUNCTION `SPLIT_STR`(x VARCHAR(255),
  delim VARCHAR(12),
  pos INT)
 RETURNS varchar(255) CHARSET utf8mb4
RETURN REPLACE(SUBSTRING(SUBSTRING_INDEX(x, delim, pos),
       LENGTH(SUBSTRING_INDEX(x, delim, pos -1)) + 1),
       delim, '')
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
